import React from 'react';
import { View, Text, StyleSheet, ScrollView } from "react-native";
import { Header } from "@rneui/base";
import { Icon, Avatar } from 'react-native-elements';

export default function NovoContato({ navigation }) {
    const goToLogin = () => {
        navigation.navigate('Login');
    };

    const list = [
        {
            name: 'Amy Farha',
            avatar_url: 'https://geekblog.com.br/wp-content/uploads/2020/12/Desktop-Wallpaper-Stormtrooper-Of-Star-Wars-Movie-Hd-Image-Picture-Background-8rgwwh.jpg.webp',
        },
        {
            name: 'Chris Jackson',
            avatar_url: 'https://geekblog.com.br/wp-content/uploads/2020/12/Desktop-Wallpaper-Stormtrooper-Of-Star-Wars-Movie-Hd-Image-Picture-Background-8rgwwh.jpg.webp',
        },
    ];

    return (
        <>
            <Header
                // ... (seu cÃ³digo do Header aqui)
            />

            <ScrollView>
                <View style={styles.container}>
                    {
                        list.map((l, i) => (
                            <View key={i} style={styles.listItem}>
                                <Avatar
                                    size="medium"
                                    rounded
                                    source={{
                                        uri: l.avatar_url,
                                    }}
                                />
                                <Text style={styles.name}>{l.name}</Text>
                            </View>
                        ))
                    }
                </View>
            </ScrollView>
        </>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        padding: 16,
    },
    listItem: {
        alignItems: 'center',
        marginBottom: 20,
    },
    name: {
        marginTop: 8,
        textAlign: 'center',
        fontSize: 18,
        fontWeight: 'bold',
    },
});
